import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className="container mt-5">
      <div className="text-center">
        <h1>Welcome to Our App!</h1>
        <p>
          Explore the list of most wanted persons, gather information, and stay updated.
        </p>
        <img 
          src="path-to-your-image.jpg" // Você pode inserir o caminho para alguma imagem destacada aqui.
          alt="A relevant alt text" 
          className="img-fluid rounded-circle"
        />
        <div className="mt-4">
          <Link to="/fbi" className="btn btn-primary">See FBI's Most Wanted</Link>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
